script: |
  super -f text -I q4802.spq | sort > q4802.out

inputs:
  - name: q4802.spq
    data: |
      SELECT ALL + cor0.col0 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE ( col0 * + cor0.col0 ) NOT IN ( col2 / col0 );
  - name: tab0

outputs:
  - name: q4802.out
    data: |
      24
      35
      89
